import './Left.css'
const Left = () => {
    return(
        <div className="left-body">
            <h1>Rent, Host, <br/> Explore.</h1>
            <p className="Description">Hr&#38;Fs provide you with the <br/> best service for house <br/> renting and hosting </p>
            <div className="Button"><p>Become a Host</p></div>
            <div className="Button"><p>Rent a House</p></div>
        </div>
    )
}
export default Left;
